class Solution:
    def maxOperations(self, s: str) -> int:
        ans = [0]
        n = len(s)
        for i in range(n):
            if s[-1-i] == '1':
                if i == 0 or s[-i] == '1':
                    ans.append(ans[-1])
                else: ans.append(ans[-1]+1)
        return sum(ans)
